function btnBusy(t) {
    t.html(t.html() + "...").attr("disabled", !0);
  }
  function btnFree(t) {
    t.html(t.html().replace("...", "")).removeAttr("disabled");
  }
  function systemError() {
    $("#ModalAlertError").modal();
  }
  function setDate(t, a, e) {
    switch (t) {
      case "today":
        var o = moment().format("DD/MM/YYYY");
        $(a).val(o), $(e).val(o), datepicDisabled(a, e, !0);
        break;
      case "yesterday":
        var n = moment().subtract(1, "days").format("DD/MM/YYYY");
        $(a).val(n), $(e).val(n), datepicDisabled(a, e, !0);
        break;
      case "this_month":
        o = moment().format("DD/MM/YYYY");
        var r = moment().startOf("month").format("DD/MM/YYYY"),
          i = moment().endOf("month").format("DD/MM/YYYY");
        $(a).val(r), $(e).val(i), datepicDisabled(a, e, !0);
        break;
      case "last_month":
        var s = moment()
            .subtract(1, "month")
            .startOf("month")
            .format("DD/MM/YYYY"),
          m = moment().subtract(1, "month").endOf("month").format("DD/MM/YYYY");
        $(a).val(s), $(e).val(m), datepicDisabled(a, e, !0);
        break;
      case "current_year":
        o = moment().format("DD/MM/YYYY");
        var c = moment().startOf("year").format("DD/MM/YYYY"),
          d = moment().endOf("year").format("DD/MM/YYYY");
        $(a).val(c), $(e).val(d), datepicDisabled(a, e, !0);
        break;
      case "custom":
        datepicDisabled(a, e, !1);
        break;
      case "all":
        $(a).val(""), $(e).val(""), datepicDisabled(a, e, !0);
    }
  }
  function datepicDisabled(t, a, e) {
    $(t).prop("disabled", e), $(a).prop("disabled", e);
  }
  function getCities(t, a) {
    $.ajax({
      type: "POST",
      url: "../Submit",
      data: { state: t, request: "getCity" },
      success: function (t) {
        $(a).html(t);
      },
    });
  }
  $(document).ready(function () {
    $.extend({
      redirectPost: function (t, a) {
        var e = $("<form></form>");
        e.attr("method", "post"),
          e.attr("target", "_blank"),
          e.attr("action", t),
          $.each(a, function (t, a) {
            var o = $("<input></input>");
            o.attr("type", "hidden"),
              o.attr("name", t),
              o.attr("value", a),
              e.append(o);
          }),
          $(e).appendTo("body").submit();
      },
    }),
      $(function () {
        $('a[data-toggle="tab"]').on("click", function (t) {
          window.localStorage.setItem("activeTab", $(t.target).attr("href"));
        });
        var t = window.localStorage.getItem("activeTab");
        t &&
          ($('.nav-tabs a[href="' + t + '"]').tab("show"),
          window.localStorage.removeItem("activeTab"));
      });
    setInterval(function () {
      var t = moment();
      $("#liteDate").html(
        t.format("ddd, DD MMM").toUpperCase() + " " + t.format("hh:mm:ss a")
      );
    }, 100);
    $(".modal button[data-dismiss='modal']").click(function () {
      $("#ckreload").is(":checked") && window.location.reload();
    });
  }),
    $(document).on("keyup keypress", "form input", function (t) {
      if (13 === (t.keyCode || t.which)) return t.preventDefault(), !1;
      $(this).parsley().validate();
    }),
    jQuery(function (t) {
      toastr.options = {
        closeButton: !0,
        progressBar: !0,
        showDuration: "100",
        hideDuration: "1000",
        fadeOut: "250",
        extendedTimeOut: "0",
        positionClass: "toast-top-right",
        tapToDismiss: !1,
        timeOut: "5000",
      };
      var a = t(".select2");
      a.select2(),
        a.on("change", function (t) {
          a.trigger("input");
        });
    }),
    $(document).on("keyup keypress", "form input", function (t) {
      if (13 === (t.keyCode || t.which)) return t.preventDefault(), !1;
      $(this).parsley().validate();
    }),
    $(".maskNumField").maskAsNumber(),
    $("#select-period").on("change", function () {
      setDate(this.value, "#frmDate", "#toDate");
    }),
    $(function () {
      $("#frmDate").flatpickr({
        maxDate: new Date().fp_incr(365),
        onChange: function (a, e) {
          t.set("minDate", e), t.setDate(e);
        },
      });
      var t = $("#toDate").flatpickr({ onChange: function (t, a) {} });
      $(".datepicker").flatpickr({ maxDate: new Date(), defaultDate: "today" });
    }),
    $(document).on("change", 'div[data-toggle="flatpickr"]', function () {
      $(this).find('input[type="text"]').parsley().validate();
    });